import React from 'react';
import './style.css';

const Experience = () => {
  return (
    <section className="experience-section">
      <h2>Experiência</h2>
      <ul>
        <li>
          <h3>EmComp - Empresa Júnior da Computação</h3>
          <p className="position">Desenvolvedora Full-Stack (Voluntária)</p>
          <p>Tempo Integral</p>
          <p>Maio de 2023 - Presente</p>
          <p>Rio Pomba, Minas Gerais, Brasil</p>
          <p>Trabalho voluntário como desenvolvedora Full-Stack
            na EmComp, participando de projetos de desenvolvimento de software e soluções
            tecnológicas para clientes e parceiros da empresa júnior.</p>
        </li>
      </ul>
    </section>
  );
}

export default Experience;
